import { BrowserRouter, Route } from "react-router-dom";

import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import App from "./app";

function Home() {
  return (
    <div>
      <h2>Home</h2>
      Home...
    </div>
  );
}

function Topics() {
  return (
    <div>
      <h2>Topics</h2>
      Topics...
    </div>
  );
}

function Contact() {
  return (
    <div>
      <h2>Contact</h2>
      Contact...
    </div>
  );
}

function App() {
  return (
    <div>
      <h1>Hello React Router DOM</h1>
      <ul>
        <li>
          <a href="/">Home</a>
        </li>
        <li>
          <a href="/topics">Topics</a>
        </li>
        <li>
          <a href="/contact">Contact</a>
        </li>
      </ul>
      <Route path="/">
        <Home></Home>
      </Route>
      <Route path="/topics">
        <Topics></Topics>{" "}
      </Route>
      <Route path="/contact">
        <Contact></Contact>{" "}
      </Route>
    </div>
  );
}

ReactDOM.render(
  <BrowserRouter>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </BrowserRouter>,
  document.getElementById("root")
);
